import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function MyButton() {
  const [count, setCount] = useState(0);
  function handleClick() {
    setCount(count+1);
  }
  return (
    <>
    <button onClick={handleClick}>I'm a button</button>
    <p>Big man clicked {count} times</p>
    </>

  );
}

function LoginPage(){

  return(
    <div class="container mt-4">
        <div class="mt-4 p-5 bg-primary text-white rounded">
            <h1>My Login Project</h1>
            <p>This project demonstrates how to implement login and register functionalities with Node.js and MySQL </p>
        </div>
    </div>
  );
}

function Testing(){
  return(
    <>
    <p>This is where I begin my villain monologue.</p>
    <h1>But <br /> nahhh</h1>
    </>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        {LoginPage}
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <body className="App-Testing">
        <p>HELLO</p>
        <MyButton />
        <Testing />
      </body>
    </div>
  );
}

export default App;
